import React from 'react';

function DogCard({ dog }) {
  return (
    <div>
      <img src={dog.img} alt={dog.name} />
      <h3>{dog.name}</h3>
      <p>Age: {dog.age}</p>
      <p>Breed: {dog.breed}</p>
      <p>Location: {dog.zip_code}</p>
    </div>
  );
}

export default DogCard;
